public class ContenidoBean {

	/** The nombre. */
	private String nombre;

	/** The id contenido. */
	private String idContenido;

	/**
	 * Obtiene nombre. Fecha: 18/02/2013
	 * 
	 * @return nombre
	 */
	public String getNombre() {
		return nombre;
	}

	/**
	 * Establece el nombre.
	 * 
	 * @param nombre el new nombre
	 */
	public void setNombre(String nombre) {
		this.nombre = nombre;
	}

	/**
	 * Obtiene id contenido seccion. Fecha: 18/02/2013
	 * 
	 * @return id contenido seccion
	 */
	public String getIdContenidoSeccion() {
		return idContenido;
	}

	/**
	 * Establece el id contenido seccion.
	 * 
	 * @param idContenidoSeccion el new id contenido seccion
	 */
	public void setIdContenidoSeccion(String idContenidoSeccion) {
		this.idContenido = idContenidoSeccion;
	}
}
